-- Volcando estructura para procedimiento db_produc.sp_AlumnoParaTitulacion_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AlumnoParaTitulacion_S`(
	IN `pPK_Alumno` BIGINT,
	IN `pAlu_Matricula` VARCHAR(50),
	IN `pAlu_Sexo` BIGINT,
	IN `pPK_Sede` TINYINT,
	IN `pPK_Carrera` TINYINT

)
BEGIN
	
	SELECT 
			A.PK_Alumno,  Alu_Matricula, Alu_Nombre, Alu_Paterno, Alu_Materno, 
			A.Alu_Sexo, CASE WHEN A.Alu_Sexo = 1 THEN 'H' WHEN A.Alu_Sexo = 0 THEN 'M' END AS Alu_SexoDescripcion,
			Alu_CURP, Alu_Semestre, Alu_Contrasena,
			C.PK_Carrera, C.Car_ClaveDGP, C.Car_Nombre, C.Car_NombreCorto, C.Car_Modalidad, CASE Car_Modalidad WHEN 1 THEN 'Escolarizado' WHEN 2 THEN 'Semiescolarizado'END AS Modalidad_Descripcion,
			CG.PK_CarrGeneracion, CG.CGe_Nombre, CG.CGe_NombreCorto,
			S.PK_Sede, S.Sed_Nombre, 
			ALS.PK_AlumSituacion, ALS.ASi_Nombre
	FROM 
			t_alumno AS A
			INNER JOIN t_carrera AS C ON A.FK_Carrera = C.PK_Carrera
			INNER JOIN t_carrerageneracion AS CG ON A.FK_CarrGeneracion = CG.PK_CarrGeneracion AND CG.FK_Carrera = C.PK_Carrera
			INNER JOIN t_sede AS S ON A.FK_Sede = S.PK_Sede
			INNER JOIN t_alumnosituacion AS ALS ON A.FK_AlumSituacion = ALS.PK_AlumSituacion
	WHERE
			A.Alu_Estatus = 1 AND A.FK_AlumSituacion IN (1,2) AND A.Alu_Semestre >= 7
			AND CASE WHEN pPK_Alumno IS NULL THEN TRUE ELSE A.PK_Alumno = pPK_Alumno END
			AND CASE WHEN pAlu_Matricula IS NULL THEN TRUE ELSE A.Alu_Matricula = pAlu_Matricula END
			AND CASE WHEN pAlu_Sexo IS NULL THEN TRUE ELSE A.Alu_Sexo = pAlu_Sexo END
			AND CASE WHEN pPK_Sede IS NULL THEN TRUE ELSE S.PK_Sede = pPK_Sede END
			AND CASE WHEN pPK_Carrera IS NULL THEN TRUE ELSE C.PK_Carrera = pPK_Carrera END;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_AlumnoSituacion_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AlumnoSituacion_S`(
	IN `pPK_AlumSituacion` TINYINT
)
BEGIN

	SELECT 
		ALS.PK_AlumSituacion, ALS.ASi_Nombre 
	FROM 
			t_alumnosituacion AS ALS
	WHERE
			ALS.ASi_Estatus = 1
			AND CASE WHEN pPK_AlumSituacion IS NULL THEN TRUE ELSE ALS.PK_AlumSituacion = pPK_AlumSituacion END;

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Alumno_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Alumno_S`(
	IN `pPK_Alumno` BIGINT,
	IN `pAlu_Matricula` VARCHAR(20),
	IN `pAlu_Sexo` BIT,
	IN `pPK_Sede` TINYINT,
	IN `pPK_Carrera` TINYINT,
	IN `pPK_CarrGeneracion` INT,
	IN `pPK_AlumSituacion` TINYINT,
	IN `pFK_Periodo_Inicio` INT,
	IN `pFK_Periodo_Fin` INT



)
BEGIN
	SET lc_time_names = 'es_ES';
	SELECT 
			A.PK_Alumno,  Alu_Matricula, Alu_Nombre, Alu_Paterno, Alu_Materno, 
			A.Alu_Sexo, CASE WHEN A.Alu_Sexo = 1 THEN 'H' WHEN A.Alu_Sexo = 0 THEN 'M' END AS Alu_SexoDescripcion,
			Alu_CURP, Alu_Semestre, Alu_Contrasena,
			C.PK_Carrera, C.Car_ClaveDGP, C.Car_Nombre, C.Car_NombreCorto, C.Car_Modalidad, CASE Car_Modalidad WHEN 1 THEN 'Escolarizado' WHEN 2 THEN 'Semiescolarizado'END AS Modalidad_Descripcion,
			CG.PK_CarrGeneracion, CG.CGe_Nombre, CG.CGe_NombreCorto,
			S.PK_Sede, S.Sed_Nombre, 
			ALS.PK_AlumSituacion, ALS.ASi_Nombre,
			PIN.PK_Periodo AS PIN_PK_Periodo, -- PIN.Per_Inicio AS PIN_Per_Inicio, PIN.Per_Fin AS PIN_Per_Fin, 
			CONCAT(
			 	CONCAT(UPPER(LEFT(MONTHNAME(PIN.Per_Inicio), 1)), LOWER(SUBSTRING(MONTHNAME(PIN.Per_Inicio), 2))) , ' - ' , 
			 	CONCAT(UPPER(LEFT(MONTHNAME(PIN.Per_Fin), 1)), LOWER(SUBSTRING(MONTHNAME(PIN.Per_Fin), 2))), 
				' ',  YEAR(PIN.Per_Fin)
			) AS PIN_Periodo, 
			PFI.PK_Periodo AS PFI_PK_Periodo, -- PFI.Per_Inicio AS PFI_Per_Inicio, PFI.Per_Fin AS PFI_Per_Fin,
			CONCAT(
			 	CONCAT(UPPER(LEFT(MONTHNAME(PFI.Per_Inicio), 1)), LOWER(SUBSTRING(MONTHNAME(PFI.Per_Inicio), 2))) , ' - ' , 
			 	CONCAT(UPPER(LEFT(MONTHNAME(PFI.Per_Fin), 1)), LOWER(SUBSTRING(MONTHNAME(PFI.Per_Fin), 2))), 
				' ',  YEAR(PFI.Per_Fin)
			) AS PFI_Periodo
	FROM 
			t_alumno AS A
			INNER JOIN t_carrera AS C ON A.FK_Carrera = C.PK_Carrera
			INNER JOIN t_carrerageneracion AS CG ON A.FK_CarrGeneracion = CG.PK_CarrGeneracion AND CG.FK_Carrera = C.PK_Carrera
			INNER JOIN t_sede AS S ON A.FK_Sede = S.PK_Sede
			INNER JOIN t_alumnosituacion AS ALS ON A.FK_AlumSituacion = ALS.PK_AlumSituacion
			INNER JOIN t_periodo AS PIN ON A.FK_Periodo_Inicio = PIN.PK_Periodo
			LEFT JOIN t_periodo AS PFI ON A.FK_Periodo_Fin = PFI.PK_Periodo
	WHERE
			A.Alu_Estatus = 1
			AND CASE WHEN pPK_Alumno IS NULL THEN TRUE ELSE A.PK_Alumno = pPK_Alumno END
			AND CASE WHEN pAlu_Matricula IS NULL THEN TRUE ELSE A.Alu_Matricula = pAlu_Matricula END
			AND CASE WHEN pAlu_Sexo IS NULL THEN TRUE ELSE A.Alu_Sexo = pAlu_Sexo END
			AND CASE WHEN pPK_Sede IS NULL THEN TRUE ELSE S.PK_Sede = pPK_Sede END
			AND CASE WHEN pPK_Carrera IS NULL THEN TRUE ELSE C.PK_Carrera = pPK_Carrera END
			AND CASE WHEN pPK_CarrGeneracion IS NULL THEN TRUE ELSE CG.PK_CarrGeneracion = pPK_CarrGeneracion END
			AND CASE WHEN pPK_AlumSituacion IS NULL THEN TRUE ELSE ALS.PK_AlumSituacion = pPK_AlumSituacion END
			AND CASE WHEN pFK_Periodo_Inicio IS NULL THEN TRUE ELSE A.FK_Periodo_Inicio = pFK_Periodo_Inicio END
			AND CASE WHEN pFK_Periodo_Fin IS NULL THEN TRUE ELSE A.FK_Periodo_Fin = pFK_Periodo_Fin END;

END//
DELIMITER ;

