-- Volcando estructura para procedimiento db_produc.sp_Bitacora_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Bitacora_S`(
	IN `pBit_Tabla` VARCHAR(50),
	IN `pBit_PK` BIGINT

)
BEGIN
	SELECT 	
				T.PK_Bitacora, T.Bit_Tabla, T.Bit_Fecha, T.Bit_PK, T.Bit_Observacion, T.Bit_Query, 
				T.Bit_Accion, 
				CASE
			    WHEN T.Bit_Accion = 1 THEN 'Alta'
			    WHEN T.Bit_Accion = 2 THEN 'Baja'
			    WHEN T.Bit_Accion = 3 THEN 'Modificación'
			    ELSE ''
				END AS Bit_Accion_Def,
				U.PK_Usuario, CONCAT(Usu_Nombre, ' ', U.Usu_Paterno, ' ', U.Usu_Materno) AS Usuario_Nombre
				
	FROM 		
				t_bitacora AS T 
				INNER JOIN t_usuario AS U ON T.Bit_FK_Usuario = U.PK_Usuario
	
	WHERE 	
				CASE WHEN pBit_Tabla IS NULL THEN TRUE	ELSE T.Bit_Tabla = pBit_Tabla END
				AND CASE WHEN pBit_PK IS NULL THEN TRUE	ELSE T.Bit_PK = pBit_PK END;

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_BI_RH_Personal2_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_BI_RH_Personal2_S`(
	IN `pFecInicio` VARCHAR(10),
	IN `pFecFin` VARCHAR(10),
	IN `pPK_Sede` TINYINT,
	IN `pPK_TipoContrato` TINYINT,
	IN `pPK_SupeJerarquico` INT,
	IN `pPK_CatePuesto` INT,
	IN `pPer_Sexo` BIT,
	IN `pPK_Departamento` INT
,
	IN `pPK_Entidad` INT,
	IN `pPK_EstaCivil` TINYINT





,
	IN `pPK_PersSituacion` TINYINT
)
BEGIN
	SET @row_number=0;
	
	SELECT
		(@row_number := @row_number +1) AS NP,
		P.PK_Personal, P.Per_Nombre, P.Per_Paterno, P.Per_Materno, P.Per_CURP, P.Per_RFC, 
		P.Per_Telefono, P.Per_Celular, P.Per_Correo,
		CASE WHEN P.Per_Sexo = 1 THEN 'H' WHEN P.Per_Sexo = 0 THEN 'M' END AS Per_SexoDescripcion,
		P.Per_DA_Calle, P.Per_DA_NumExt, P.Per_DA_NumInt, 
		L.PK_Localidad, L.Loc_Nombre, L.Loc_CP,
		M.PK_Municipio, M.Mun_Nombre,
		E.PK_Entidad, E.EFe_Nombre,
		S.PK_Sede, S.Sed_Nombre,
		EC.PK_EstaCivil, EC.ECi_Nombre,
		PS.PK_PersSituacion, PS.PSi_Nombre	
	FROM
		t_personal AS P
		INNER JOIN t_sede AS S ON P.FK_Sede = S.PK_Sede
		INNER JOIN t_estadocivil AS EC ON P.FK_EstaCivil = EC.PK_EstaCivil
		INNER JOIN t_localidad AS L ON L.PK_Localidad = P.FK_LocalidadDA
		INNER JOIN t_municipio AS M ON M.PK_Municipio = L.FK_Municipio
		INNER JOIN t_entidad AS E ON E.PK_Entidad = M.FK_Entidad
		INNER JOIN t_personalsituacion AS PS ON PS.PK_PersSituacion = P.FK_PersSituacion
	WHERE
		P.Per_Estatus = 1
		AND CASE WHEN pFecInicio = 'NULL' THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
		AND CASE WHEN pPK_Sede IS NULL THEN TRUE ELSE P.FK_Sede = pPK_Sede END
		AND CASE WHEN pPK_TipoContrato IS NULL THEN TRUE ELSE P.FK_TipoContrato = pPK_TipoContrato END
		AND CASE WHEN pPK_SupeJerarquico IS NULL THEN TRUE ELSE P.FK_SupeJerarquico = pPK_SupeJerarquico END
		AND CASE WHEN pPK_Departamento IS NULL THEN TRUE ELSE P.FK_Departamento = pPK_Departamento END
		AND CASE WHEN pPK_CatePuesto IS NULL THEN TRUE ELSE P.FK_CatePuesto = pPK_CatePuesto END
		AND CASE WHEN pPK_Entidad IS NULL THEN TRUE ELSE E.PK_Entidad = pPK_Entidad END
		AND CASE WHEN pPK_EstaCivil IS NULL THEN TRUE ELSE P.FK_EstaCivil = pPK_EstaCivil END
		AND CASE WHEN pPer_Sexo IS NULL THEN TRUE ELSE P.Per_Sexo = pPer_Sexo END
		AND CASE WHEN pPK_PersSituacion IS NULL THEN TRUE ELSE P.FK_PersSituacion = pPK_PersSituacion END;
	-- ORDER BY P.Per_Paterno, P.Per_Materno, P.Per_Nombre;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_BI_RH_Personal_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_BI_RH_Personal_S`(
	IN `pFecInicio` VARCHAR(10),
	IN `pFecFin` VARCHAR(10)
,
	IN `pPK_Sede` TINYINT,
	IN `pPK_TipoContrato` TINYINT,
	IN `pPK_SupeJerarquico` INT,
	IN `pPK_CatePuesto` INT,
	IN `pPer_Sexo` BIT,
	IN `pPK_Departamento` INT




,
	IN `pPK_PersSituacion` TINYINT


)
BEGIN
	SET @row_number=0;
	
	SELECT
		(@row_number := @row_number +1) AS NP,
		P.PK_Personal, P.Per_Nombre, P.Per_Paterno, P.Per_Materno, P.Per_CURP, P.Per_RFC, P.Per_FecIngreso, 
		P.Per_Sexo, CASE WHEN P.Per_Sexo = 1 THEN 'H' WHEN P.Per_Sexo = 0 THEN 'M' END AS Per_SexoDescripcion,
		'Técnico Superior' AS NivelEstudio, 
		IFNULL((SELECT DISTINCT 'Si' AS DI FROM t_personal_discapacidad AS PD WHERE PD.PDi_Estatus = 1 AND PD.FK_Personal = P.PK_Personal), 'No') AS Discapacidad, 
		
		IFNULL((SELECT DISTINCT 'Si' AS HN FROM t_personal_lengua AS PLN INNER JOIN t_lengua AS L ON PLN.FK_Lengua = L.PK_Lengua 
			WHERE L.Len_Tipo = 1 AND PLN.PLe_Estatus = 1 AND PLN.FK_Personal = P.PK_Personal), 'No') AS HablanteNacional,
			
		IFNULL((SELECT DISTINCT 'Si' AS HN FROM t_personal_lengua AS PLN INNER JOIN t_lengua AS L ON PLN.FK_Lengua = L.PK_Lengua 
			WHERE L.Len_Tipo = 2 AND PLN.PLe_Estatus = 1 AND PLN.FK_Personal = P.PK_Personal), 'No') AS HablanteExtranjera,
			
		S.PK_Sede, S.Sed_Nombre,		
		TC.PK_TipoContrato, TC.TCo_Nombre,
		SJ.PK_SupeJerarquico, SJ.SJe_Nombre, SJ.SJe_Abreviatura,
		D.PK_Departamento, D.Dep_Nombre, D.Dep_Abreviatura,
		CP.PK_CatePuesto, CP.CPu_Nombre,
		PU.PK_Puesto, PU.Pue_Nombre,
		PS.PK_PersSituacion, PS.PSi_Nombre
	FROM
		t_personal AS P
		INNER JOIN t_sede AS S ON P.FK_Sede = S.PK_Sede
		INNER JOIN t_tipocontrato AS TC ON P.FK_TipoContrato = TC.PK_TipoContrato
		INNER JOIN t_superiorjerarquico AS SJ ON P.FK_SupeJerarquico = SJ.PK_SupeJerarquico
		INNER JOIN t_departamento AS D ON P.FK_Departamento = D.PK_Departamento
		INNER JOIN t_categoriapuesto AS CP ON P.FK_CatePuesto = CP.PK_CatePuesto
		INNER JOIN t_puesto AS PU ON P.FK_Puesto = PU.PK_Puesto
		INNER JOIN t_personalsituacion AS PS ON PS.PK_PersSituacion = P.FK_PersSituacion
	WHERE
		P.Per_Estatus = 1
		AND CASE WHEN pFecInicio = 'NULL' THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
		AND CASE WHEN pPK_Sede IS NULL THEN TRUE ELSE P.FK_Sede = pPK_Sede END
		AND CASE WHEN pPK_TipoContrato IS NULL THEN TRUE ELSE P.FK_TipoContrato = pPK_TipoContrato END
		AND CASE WHEN pPK_SupeJerarquico IS NULL THEN TRUE ELSE P.FK_SupeJerarquico = pPK_SupeJerarquico END
		AND CASE WHEN pPK_Departamento IS NULL THEN TRUE ELSE P.FK_Departamento = pPK_Departamento END
		AND CASE WHEN pPK_CatePuesto IS NULL THEN TRUE ELSE P.FK_CatePuesto = pPK_CatePuesto END
		AND CASE WHEN pPer_Sexo IS NULL THEN TRUE ELSE P.Per_Sexo = pPer_Sexo END
		AND CASE WHEN pPK_PersSituacion IS NULL THEN TRUE ELSE P.FK_PersSituacion = pPK_PersSituacion END;
END//
DELIMITER ;

