-- Volcando estructura para procedimiento db_produc.sp_Documentos_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Documentos_S`(IN `pPK_Documentos` INT)
BEGIN
	SELECT 
    	D.PK_Documentos, D.Doc_Nombre, D.Doc_Indicacion,
    	DC.PK_DocuClasificacion, DC.DCl_Nombre,
    	NR.PK_NivelReq,
    	CASE
			    WHEN NR.NivelReq_Nombre = 1 THEN 'Obligatorio'
			    WHEN NR.NivelReq_Nombre = 2 THEN 'Opcional'
			    WHEN NR.NivelReq_Nombre = 3 THEN 'Recomendado'
			    ELSE ''
			END AS NivelReq_Nombre_Def
    		
    FROM 
    	t_documentos AS D 
    	INNER JOIN t_documentos_clasificacion AS DC ON D.FK_DocuClasificacion = DC.PK_DocuClasificacion
    	INNER JOIN t_nivelrequerimiento AS NR ON D.FK_NivelReq = NR.PK_NivelReq
    WHERE 	
		D.Doc_Estatus = 1

		AND CASE WHEN pPK_Documentos IS NULL THEN TRUE	ELSE D.PK_Documentos = pPK_Documentos END;
	END//
DELIMITER ;

