-- Volcando estructura para procedimiento db_produc.sp_Esta_REC_PersonalTipo_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Esta_REC_PersonalTipo_S`()
BEGIN

	SELECT
		'Académicos' AS PersTipo, 
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			INNER JOIN t_departamento AS DEP ON P.FK_Departamento = DEP.PK_Departamento 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND
			DEP.FK_SupeJerarquico IN (1,3) AND DEP.PK_Departamento NOT IN (1,2,3)
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF
			FROM t_personal AS P 
			INNER JOIN t_departamento AS DEP ON P.FK_Departamento = DEP.PK_Departamento 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND
			DEP.FK_SupeJerarquico IN (1,3) AND DEP.PK_Departamento NOT IN (1,2,3)
		) AS CantF
		
		UNION ALL
		
		SELECT
		'Administrativos' AS PersTipo, 
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			INNER JOIN t_departamento AS DEP ON P.FK_Departamento = DEP.PK_Departamento 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND
			DEP.FK_SupeJerarquico IN (1,2,4) AND DEP.PK_Departamento NOT IN (4,5)
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF
			FROM t_personal AS P 
			INNER JOIN t_departamento AS DEP ON P.FK_Departamento = DEP.PK_Departamento 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND
			DEP.FK_SupeJerarquico IN (1,2,4) AND DEP.PK_Departamento NOT IN (4,5)
		) AS CantF;

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Esta_RH_Antiguedad_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Esta_RH_Antiguedad_S`(
	IN `pDocenteAdministrativo` BIT


)
BEGIN
	SELECT 
		CE.PK_ConcEstadistica,
		CE.CES_Nombre,
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 
			AND P.Per_Sexo = 1 
			AND TIMESTAMPDIFF(YEAR,P.Per_FecIngreso,CURDATE()) BETWEEN CE.CES_Condicional1 AND CE.CES_Condicional2 
			AND  
				CASE 
					WHEN pDocenteAdministrativo IS NULL THEN TRUE 
					ELSE 
						P.FK_CatePuesto IN (
							SELECT CP.PK_CatePuesto 
								FROM t_categoriapuesto AS CP 
								WHERE CP.CPu_Estatus = 1 AND 
								CASE  
									WHEN pDocenteAdministrativo = 1 THEN CP.CPu_Nombre LIKE '%Docente%' 
									WHEN pDocenteAdministrativo = 0 THEN CP.CPu_Nombre NOT LIKE '%Docente%' 
								END
						)  
				END
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 
			AND P.Per_Sexo = 0 
			AND TIMESTAMPDIFF(YEAR,P.Per_FecIngreso,CURDATE()) BETWEEN CE.CES_Condicional1 AND CE.CES_Condicional2 
			AND  
				CASE 
					WHEN pDocenteAdministrativo IS NULL THEN TRUE 
					ELSE 
						P.FK_CatePuesto IN (
							SELECT CP.PK_CatePuesto 
								FROM t_categoriapuesto AS CP 
								WHERE CP.CPu_Estatus = 1 AND 
								CASE  
									WHEN pDocenteAdministrativo = 1 THEN CP.CPu_Nombre LIKE '%Docente%' 
									WHEN pDocenteAdministrativo = 0 THEN CP.CPu_Nombre NOT LIKE '%Docente%' 
								END
						)  
				END
		) AS CantF
	
	FROM t_conceptoestadistica AS CE
	WHERE 
		CE.CES_Agrupacion ='Antiguedad'
		AND CE.CES_Estatus = 1	
	ORDER BY CE.CES_Orden;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Esta_RH_AreaFormacion_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Esta_RH_AreaFormacion_S`(
	IN `pDocenteAdministrativo` BIT

)
    COMMENT 'pDocenteAdministrativo 1)Docente y 0 Administrativo'
BEGIN
	SELECT 
		AF.PK_AreaFormacion, AF.AFo_Nombre,
		(
			SELECT IFNULL(COUNT(*),0) AS CantM 
			FROM t_personal AS P 
			WHERE P.FK_AreaFormacion = AF.PK_AreaFormacion 
				AND P.Per_Estatus = 1 
				AND P.Per_Sexo = 1 
				AND 
					CASE 
						WHEN pDocenteAdministrativo IS NULL THEN TRUE 
						ELSE 
							P.FK_CatePuesto IN (
								SELECT CP.PK_CatePuesto 
									FROM t_categoriapuesto AS CP 
									WHERE CP.CPu_Estatus = 1 AND 
									CASE  
										WHEN pDocenteAdministrativo = 1 THEN CP.CPu_Nombre LIKE '%Docente%' 
										WHEN pDocenteAdministrativo = 0 THEN CP.CPu_Nombre NOT LIKE '%Docente%' 
									END
							)  
					END
		) AS CantM,
		(
			SELECT IFNULL(COUNT(*),0) AS CantF 
			FROM t_personal AS P 
			WHERE P.FK_AreaFormacion = AF.PK_AreaFormacion 
				AND P.Per_Estatus = 1 
				AND P.Per_Sexo = 0
				AND  
					CASE 
						WHEN pDocenteAdministrativo IS NULL THEN TRUE 
						ELSE 
							P.FK_CatePuesto IN (
								SELECT CP.PK_CatePuesto 
									FROM t_categoriapuesto AS CP 
									WHERE CP.CPu_Estatus = 1 AND 
									CASE  
										WHEN pDocenteAdministrativo = 1 THEN CP.CPu_Nombre LIKE '%Docente%' 
										WHEN pDocenteAdministrativo = 0 THEN CP.CPu_Nombre NOT LIKE '%Docente%' 
									END
							)  
					END
		) AS CantF
	FROM t_areaformacion AS AF	
	WHERE AF.AFo_Estatus = 1;
	
	

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Esta_RH_Edad2_S
DELIMITER //
