		SELECT 
		1 AS PK_NivEstudio, 
		'Ninguno' AS NivelEstudio, 
			(
				SELECT COUNT(*) AS CantM 
				FROM t_personal AS P 
				WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1
				AND CASE WHEN pFecInicio IS NULL THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
				AND P.PK_Personal NOT IN 
				(
					SELECT 
						DISTINCT T.FK_Personal
					FROM
					(
						SELECT PFB.FK_Personal FROM t_personal_formacionbasica AS PFB WHERE PFB.PFB_Estatus = 1 AND PFB.PFB_UG = 1
						UNION ALL
						SELECT PFP.FK_Personal FROM t_personal_formacionprofesional AS PFP WHERE PFP.PFP_Estatus = 1 AND PFP.PFP_UG = 1
						UNION ALL
						SELECT PPo.FK_Personal FROM t_personal_formacionpostgrados AS PPo WHERE PPo.PPo_Estatus = 1 AND PPo.PPo_UG = 1
					) AS T
				)
			) AS CantM,
			(
				SELECT COUNT(*) AS CantF 
					FROM t_personal AS P 
					WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0
					AND CASE WHEN pFecInicio IS NULL THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
					AND P.PK_Personal NOT IN 
					(
						SELECT 
							DISTINCT T.FK_Personal
						FROM
						(
							SELECT PFB.FK_Personal FROM t_personal_formacionbasica AS PFB WHERE PFB.PFB_Estatus = 1 AND PFB.PFB_UG = 1
							UNION ALL
							SELECT PFP.FK_Personal FROM t_personal_formacionprofesional AS PFP WHERE PFP.PFP_Estatus = 1 AND PFP.PFP_UG = 1
							UNION ALL
							SELECT PPo.FK_Personal FROM t_personal_formacionpostgrados AS PPo WHERE PPo.PPo_Estatus = 1 AND PPo.PPo_UG = 1
						) AS T
					)
			) AS CantF
			
		UNION ALL
		
		SELECT 
			2 AS PK_NivEstudio, 
			'Primaria' AS NivelEstudio, 
			(
				SELECT COUNT(*) AS CantM 
				FROM t_personal_formacionbasica AS PFB
				INNER JOIN t_personal AS P ON PFB.FK_Personal = P.PK_Personal
				WHERE PFB.PFB_Estatus = 1 AND PFB.PFB_UG = 1 AND P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND PFB.FK_FormBasica = 2
				AND CASE WHEN pFecInicio IS NULL THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
