				WHERE PFB.PFB_Estatus = 1 AND PFB.PFB_UG = 1 AND P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND PFB.FK_FormBasica = 2
				AND CASE WHEN pFecInicio IS NULL THEN TRUE ELSE P.Per_FecIngreso BETWEEN pFecInicio AND pFecFin END
			) AS CantF
		
