-- Volcando estructura para procedimiento db_produc.sp_Esta_RH_PersonalCategoria_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Esta_RH_PersonalCategoria_S`()
BEGIN
	SELECT 
		CP.PK_CatePuesto, CP.CPu_Nombre,
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND P.FK_TipoContrato = 1 AND P.FK_CatePuesto = CP.PK_CatePuesto
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND P.FK_TipoContrato = 1 AND P.FK_CatePuesto = CP.PK_CatePuesto
		) AS CantF
		
	FROM
		t_categoriapuesto AS CP
	WHERE
		CP.CPu_Estatus = 1
	
	UNION ALL
	
	SELECT 
		1000, 'Honorarios' AS CPu_Nombre,
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND P.FK_TipoContrato = 2
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF 
			FROM t_personal AS P 
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND P.FK_TipoContrato = 2
		) AS CantF;
END//
DELIMITER ;

