-- Volcando estructura para procedimiento db_produc.sp_Esta_RH_Tiempo_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Esta_RH_Tiempo_S`()
BEGIN
	SELECT 
		CE.PK_ConcEstadistica, CE.CES_Nombre,
		(
			SELECT COUNT(*) AS CantM 
			FROM t_personal AS P 
			INNER JOIN t_categoriapuesto AS CP ON P.FK_CatePuesto = CP.PK_CatePuesto
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND P.FK_TipoContrato = 1 AND CP.CPu_Nombre LIKE CONCAT('%',CE.CES_Nombre,'%') 
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF 
			FROM t_personal AS P 
			INNER JOIN t_categoriapuesto AS CP ON P.FK_CatePuesto = CP.PK_CatePuesto
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND P.FK_TipoContrato = 1 AND CP.CPu_Nombre LIKE CONCAT('%',CE.CES_Nombre,'%') 
		) AS CantF
	FROM t_conceptoestadistica AS CE
	WHERE 
		CE.CES_Agrupacion ='DocTipoCon'
		AND CE.CES_Estatus = 1	
	
	UNION ALL 
	
	SELECT 
		CE.PK_ConcEstadistica, CE.CES_Nombre,
		(
			SELECT COUNT(*) AS CantM
			FROM t_personal AS P 
			INNER JOIN t_categoriapuesto AS CP ON CP.PK_CatePuesto = P.FK_CatePuesto
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 1 AND P.FK_TipoContrato = 2 AND P.FK_CatePuesto IN (35) 
		) AS CantM,
		(
			SELECT COUNT(*) AS CantF
			FROM t_personal AS P 
			INNER JOIN t_categoriapuesto AS CP ON CP.PK_CatePuesto = P.FK_CatePuesto
			WHERE P.Per_Estatus = 1 AND P.Per_Sexo = 0 AND P.FK_TipoContrato = 2 AND P.FK_CatePuesto IN (35) 
		) AS CantF
	FROM t_conceptoestadistica AS CE
	WHERE 
		CE.CES_Agrupacion ='DocTipoConH'
		AND CE.CES_Estatus = 1;

END//
DELIMITER ;

