DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Localidad_S`(IN `pPK_Localidad` INT,
	IN `pPK_Municipio` INT)
BEGIN
	SELECT 
			L.PK_Localidad, L.Loc_Nombre, L.Loc_CP,
			M.PK_Municipio, M.Mun_Nombre,
			P.PK_Pais, P.Pai_NombreCorto,
			E.PK_Entidad, E.EFe_Nombre  
	FROM 
			t_localidad AS L
			INNER JOIN t_municipio AS M ON M.PK_Municipio = L.FK_Municipio
			INNER JOIN t_entidad AS E ON E.PK_Entidad = M.FK_Entidad
			INNER JOIN t_pais AS P ON P.PK_Pais = E.FK_Pais
	WHERE
			L.Loc_Estatus = 1 
			AND M.Mun_Estatus = 1
			AND P.Pai_Estatus = 1
			AND E.EFe_Estatus = 1
			AND CASE WHEN pPK_Localidad IS NULL THEN TRUE ELSE L.PK_Localidad = pPK_Localidad END
			AND CASE WHEN pPK_Municipio IS NULL THEN TRUE ELSE M.PK_Municipio = pPK_Municipio END;
END//
