	SELECT 
	    	NR.PK_NivelReq,
	    	CASE
				    WHEN NR.NivelReq_Nombre = 1 THEN 'Obligatorio'
				    WHEN NR.NivelReq_Nombre = 2 THEN 'Opcional'
				    WHEN NR.NivelReq_Nombre = 3 THEN 'Recomendado'
				    ELSE ''
				    END AS NivelReq_Nombre
	    FROM 
	    	t_nivelrequerimiento AS NR 
	    WHERE 
	    	NR.NivelReq_Estatus = 1
	      AND CASE WHEN pPK_NivelReq IS NULL THEN TRUE ELSE NR.PK_NivelReq = pPK_NivelReq END;

END//
DELIMITER ;

