-- Volcando estructura para procedimiento db_produc.sp_Periodo_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Periodo_S`(
	IN `pPK_Periodo` INT


)
BEGIN
	SELECT 
			P.PK_Periodo, P.Per_Descripcion, P.Per_Inicio, P.Per_Fin,
			CONCAT(
			 	CONCAT(UPPER(LEFT(MONTHNAME(P.Per_Inicio), 1)), LOWER(SUBSTRING(MONTHNAME(P.Per_Inicio), 2))) , ' - ' , 
			 	CONCAT(UPPER(LEFT(MONTHNAME(P.Per_Fin), 1)), LOWER(SUBSTRING(MONTHNAME(P.Per_Fin), 2))), 
				' ',  YEAR(P.Per_Fin)
			) AS Periodo 
	FROM 
			t_periodo AS P
	WHERE
			P.Per_Estatus = 1
			AND CASE WHEN pPK_Periodo IS NULL THEN TRUE ELSE P.PK_Periodo = pPK_Periodo END;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Personal2_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Personal2_S`(IN `pPK_Sede` TINYINT,
	IN `pPK_TipoContrato` TINYINT,
	IN `pPK_SupeJerarquico` INT,
	IN `pPK_CatePuesto` INT,
	IN `pPer_Sexo` BIT,
	IN `pPK_Departamento` INT,
	IN `pPK_PersSituacion` TINYINT,
	IN `pPK_EstaCivil` TINYINT)
BEGIN

	SELECT
		P.PK_Personal, P.Per_Nombre, P.Per_Paterno, P.Per_Materno, P.Per_CURP, P.Per_RFC, P.Per_FecIngreso, 
		P.Per_Sexo, CASE WHEN P.Per_Sexo = 1 THEN 'Masculino' WHEN P.Per_Sexo = 0 THEN 'Femenino' END AS Per_SexoDescripcion,
		S.PK_Sede, S.Sed_Nombre,
		PS.PK_PersSituacion, PS.PSi_Nombre
	FROM
		t_personal AS P
		INNER JOIN t_sede AS S ON P.FK_Sede = S.PK_Sede
		INNER JOIN t_personalsituacion AS PS ON P.FK_PersSituacion = PS.PK_PersSituacion
	WHERE
		P.Per_Estatus = 1
		AND CASE WHEN pPK_Sede IS NULL THEN TRUE ELSE P.FK_Sede = pPK_Sede END
		AND CASE WHEN pPK_TipoContrato IS NULL THEN TRUE ELSE P.FK_TipoContrato = pPK_TipoContrato END
		AND CASE WHEN pPK_SupeJerarquico IS NULL THEN TRUE ELSE P.FK_SupeJerarquico = pPK_SupeJerarquico END
		AND CASE WHEN pPK_Departamento IS NULL THEN TRUE ELSE P.FK_Departamento = pPK_Departamento END
		AND CASE WHEN pPK_CatePuesto IS NULL THEN TRUE ELSE P.FK_CatePuesto = pPK_CatePuesto END
		AND CASE WHEN pPer_Sexo IS NULL THEN TRUE ELSE P.Per_Sexo = pPer_Sexo END
		AND CASE WHEN pPK_PersSituacion IS NULL THEN TRUE ELSE P.FK_PersSituacion = pPK_PersSituacion END
		AND CASE WHEN pPK_EstaCivil IS NULL THEN TRUE ELSE P.FK_EstaCivil = pPK_EstaCivil END
	ORDER BY P.PK_Personal;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_PersonalSimple_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_PersonalSimple_S`(IN `pPK_Personal` INT)
BEGIN
	SELECT 
		P.PK_Personal, P.Per_Nombre, P.Per_Paterno, P.Per_Materno, 
		P.Per_CURP, P.Per_RFC, P.Per_NSS, P.Per_CredInfonavit, P.Per_CredFonacot,
		P.Per_Sexo, CASE WHEN P.Per_Sexo = 1 THEN 'Hombre' WHEN P.Per_Sexo = 0 THEN 'Mujer' END AS Per_SexoDescripcion,
		P.Per_FecNacimiento, P.Per_Correo, P.Per_Telefono, P.Per_Celular, P.Per_FecIngreso,
		Per_DA_Calle, Per_DA_NumExt,Per_DA_NumInt,
		FK_Sede, FK_SupeJerarquico, FK_Departamento, FK_CatePuesto, FK_Puesto, FK_TipoContrato, FK_EstaCivil, 
		FK_AreaFormacion, FK_PersSituacion,
		EDA.FK_Pais AS EDA_PK_Pais, EDA.PK_Entidad AS EDA_PK_Entidad, MDA.PK_Municipio AS MDA_PK_Municipio, LDA.PK_Localidad AS  LDA_PK_Localidad, 
		ENA.FK_Pais AS ENA_PK_Pais, ENA.PK_Entidad AS ENA_PK_Entidad, MNA.PK_Municipio AS MNA_PK_Municipio, LNA.PK_Localidad AS LNA_PK_Localidad 
	FROM 
		t_personal AS P 	
		INNER JOIN t_localidad AS LDA ON LDA.PK_Localidad = P.FK_LocalidadDA
		INNER JOIN t_municipio AS MDA ON MDA.PK_Municipio = LDA.FK_Municipio
		INNER JOIN t_entidad AS EDA ON EDA.PK_Entidad = MDA.FK_Entidad
		
		INNER JOIN t_localidad AS LNA ON LNA.PK_Localidad = P.FK_LocalidadNac
		INNER JOIN t_municipio AS MNA ON MNA.PK_Municipio = LNA.FK_Municipio
		INNER JOIN t_entidad AS ENA ON ENA.PK_Entidad = MNA.FK_Entidad
	WHERE
		P.Per_Estatus = 1 
		AND CASE WHEN pPK_Personal IS NULL THEN TRUE ELSE P.PK_Personal = pPK_Personal END;
END//
DELIMITER ;

