	IN `pFK_Usuario` INT,
	IN `pObservacion` LONGTEXT,
	IN `pQuery` LONGTEXT


)
BEGIN
	SET @vDiscapacidad := (SELECT 1 FROM t_personal_discapacidad AS PD WHERE PD.FK_Personal = pFK_Personal AND PD.FK_Discapacidad = pFK_Discapacidad LIMIT 1);

	IF @vDiscapacidad = 1 THEN 
		UPDATE 	t_personal_discapacidad 
		SET 		PDi_Estatus=1 
		WHERE  	FK_Personal = pFK_Personal AND FK_Discapacidad = pFK_Discapacidad;

		SET @vBit_PK := (SELECT PD.PK_PerDis FROM t_personal_discapacidad AS PD WHERE PD.FK_Personal = pFK_Personal AND PD.FK_Discapacidad = pFK_Discapacidad LIMIT 1);
		SELECT @vBit_Accion := 3;
	ELSE
	
		SELECT @vBit_PK := LAST_INSERT_ID();
		SELECT @vBit_Accion := 1;
		
		CALL sp_Bitacora_I('t_personal_discapacidad', @vBit_PK, pFK_Usuario, @vBit_Accion, pObservacion, pQuery);
	END IF;
END//
