DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Personal_I`(
	IN `pFK_Sede` TINYINT,
	IN `pFK_SupeJerarquico` TINYINT,
	IN `pFK_Departamento` INT,
	IN `pFK_CatePuesto` INT,
	IN `pFK_Puesto` INT,
	IN `pFK_TipoContrato` TINYINT,
	IN `pFK_EstaCivil` TINYINT,
	IN `pFK_LocalidadNac` INT,
	IN `pFK_LocalidadDA` INT,
	IN `pFK_AreaFormacion` TINYINT,
	IN `pPer_Nombre` VARCHAR(50),
	IN `pPer_Paterno` VARCHAR(50),
	IN `pPer_Materno` VARCHAR(50),
	IN `pPer_CURP` VARCHAR(18),
	IN `pPer_RFC` VARCHAR(20),
	IN `pPer_NSS` VARCHAR(20),
	IN `pPer_CredInfonavit` VARCHAR(30),
	IN `pPer_CredFonacot` VARCHAR(30),
	IN `pPer_Sexo` BIT,
	IN `pPer_FecNacimiento` VARCHAR(10),
	IN `pPer_Correo` VARCHAR(50),
	IN `pPer_Telefono` VARCHAR(50),
	IN `pPer_Celular` VARCHAR(50),
	IN `pPer_FecIngreso` VARCHAR(10),
	IN `pPer_DA_Calle` VARCHAR(1000),
	IN `pPer_DA_NumExt` VARCHAR(10),
	IN `pPer_DA_NumInt` VARCHAR(10),
	IN `pFK_Usuario` INT,
	IN `pObservacion` LONGTEXT




,
	IN `pQuery` LONGTEXT


)
BEGIN
	SET @vPK_Personal := (SELECT P.PK_Personal FROM t_personal AS P WHERE P.Per_CURP = pPer_CURP);

	IF @vPK_Personal > 0 THEN 
		SELECT 'CURP' AS PK_Personal;
	ELSE
			FK_LocalidadNac, FK_LocalidadDA, Per_Nombre, Per_Paterno, Per_Materno, Per_CURP, Per_RFC, Per_NSS, 
			Per_CredInfonavit, Per_CredFonacot, Per_Sexo, Per_FecNacimiento, Per_Correo, Per_Telefono, Per_Celular, 
			Per_FecIngreso, Per_DA_Calle, Per_DA_NumExt, Per_DA_NumInt, FK_AreaFormacion) 
		VALUES 
			(pFK_Sede, pFK_SupeJerarquico, pFK_Departamento, pFK_CatePuesto, pFK_Puesto, pFK_TipoContrato, pFK_EstaCivil, 
			pFK_LocalidadNac, pFK_LocalidadDA,pPer_Nombre, pPer_Paterno, pPer_Materno, pPer_CURP, pPer_RFC, pPer_NSS, 
			pPer_CredInfonavit, pPer_CredFonacot, pPer_Sexo, pPer_FecNacimiento,	pPer_Correo, pPer_Telefono, pPer_Celular, 
			pPer_FecIngreso, pPer_DA_Calle, pPer_DA_NumExt, pPer_DA_NumInt, pFK_AreaFormacion);
	
		SELECT @vBit_PK := LAST_INSERT_ID() AS PK_Personal;
		
		CALL sp_Bitacora_I('t_personal', @vBit_PK, pFK_Usuario, 1, pObservacion, pQuery);
	END IF;
END//
DELIMITER ;

