-- Volcando estructura para procedimiento db_produc.sp_Personal_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Personal_S`(
	IN `pPK_Personal` INT



)
BEGIN
	
	SELECT 
		P.PK_Personal, P.Per_Nombre, P.Per_Paterno, P.Per_Materno, 
		P.Per_CURP, P.Per_RFC, P.Per_NSS, P.Per_CredInfonavit, P.Per_CredFonacot,
		P.Per_Sexo, CASE WHEN P.Per_Sexo = 1 THEN 'Hombre' WHEN P.Per_Sexo = 0 THEN 'Mujer' END AS Per_SexoDescripcion,
		P.Per_FecNacimiento, P.Per_Correo, P.Per_Telefono, P.Per_Celular, P.Per_FecIngreso, 
		
		PDA.PK_Pais, PDA.Pai_NombreCorto, EDA.PK_Entidad, EDA.EFe_Nombre, MDA.PK_Municipio, MDA.Mun_Nombre,
		LDA.PK_Localidad, LDA.Loc_Nombre, LDA.Loc_CP,P.Per_DA_Calle, P.Per_DA_NumExt, P.Per_DA_NumInt,
		
		PDN.PK_Pais, PDN.Pai_NombreCorto, EDN.PK_Entidad, EDN.EFe_Nombre, MDN.PK_Municipio, MDN.Mun_Nombre,
		LDN.PK_Localidad, LDN.Loc_Nombre, LDN.Loc_CP,

		S.PK_Sede, S.Sed_Nombre,
		SJ.PK_SupeJerarquico, SJ.SJe_Nombre,
		D.PK_Departamento, D.Dep_Nombre,
		CP.PK_CatePuesto, CP.CPu_Nombre,
		PU.PK_Puesto, PU.Pue_Nombre,
		TC.PK_TipoContrato, TC.TCo_Nombre,
		EC.PK_EstaCivil, EC.ECi_Nombre
		
	
	FROM 
		t_personal AS P 
		INNER JOIN t_sede AS S ON S.PK_Sede = P.FK_Sede
		INNER JOIN t_superiorjerarquico AS SJ ON SJ.PK_SupeJerarquico = P.FK_SupeJerarquico
		INNER JOIN t_departamento AS D ON D.PK_Departamento = P.FK_Departamento
		INNER JOIN t_categoriapuesto AS CP ON CP.PK_CatePuesto = P.FK_CatePuesto
		INNER JOIN t_puesto AS PU ON PU.PK_Puesto = P.FK_Puesto
		INNER JOIN t_tipocontrato AS TC ON TC.PK_TipoContrato = P.FK_TipoContrato
		INNER JOIN t_estadocivil AS EC ON EC.PK_EstaCivil = P.FK_EstaCivil
		
		LEFT JOIN t_localidad AS LDA ON LDA.PK_Localidad = P.FK_LocalidadDA
		LEFT JOIN t_municipio AS MDA ON MDA.PK_Municipio = LDA.FK_Municipio
		LEFT JOIN t_entidad AS EDA ON EDA.PK_Entidad = MDA.FK_Entidad
		LEFT JOIN t_pais AS PDA ON PDA.PK_Pais = EDA.FK_Pais
		
		LEFT JOIN t_localidad AS LDN ON LDN.PK_Localidad = P.FK_LocalidadNac
		LEFT JOIN t_municipio AS MDN ON MDN.PK_Municipio = LDN.FK_Municipio
		LEFT JOIN t_entidad AS EDN ON EDN.PK_Entidad = MDN.FK_Entidad
		LEFT JOIN t_pais AS PDN ON PDN.PK_Pais = EDN.FK_Pais
			
	WHERE
		P.Per_Estatus = 1
      AND CASE WHEN pPK_Personal IS NULL THEN TRUE ELSE P.PK_Personal = pPK_Personal END
	ORDER BY P.Per_Paterno, P.Per_Materno, P.Per_Nombre;

END//
DELIMITER ;

