	IN `pFK_ProfAsoc` TINYINT,
	IN `pTit_Tema` LONGTEXT,
	IN `pTit_NumOficio` VARCHAR(50),
	IN `pTit_FecRegistro` VARCHAR(10),
	IN `pTit_FecLimite` VARCHAR(10),
	IN `pFK_Usuario` INT,
	IN `pObservacion` LONGTEXT,
	IN `pQuery` LONGTEXT
)
BEGIN
	VALUES (pFK_Alumno, pFK_Departamento, pFK_TitModalidad, pFK_Personal_Director, pFK_ProfAsoc, pTit_Tema, pTit_NumOficio, pTit_FecRegistro, pTit_FecLimite);
	
	SELECT @vBit_PK :=  LAST_INSERT_ID();
	
	CALL sp_Bitacora_I('t_titulacion', @vBit_PK, pFK_Usuario, 1, pObservacion, pQuery);

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_Titulacion_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Titulacion_S`(
	IN `pPK_Titulacion` INT,
	IN `pPK_Alumno` INT,
	IN `pAlu_Matricula` VARCHAR(50),
	IN `pAlu_Sexo` BIT,
	IN `pPK_Carrera` TINYINT,
	IN `pPK_Departamento` INT,
	IN `pPK_TitModalidad` TINYINT,
	IN `pPK_ProfAsoc` TINYINT
,
	IN `pTipoTitulacion` TINYINT

)
BEGIN
	SELECT 
			T.PK_Titulacion, T.Tit_Tema, T.Tit_NumOficio, T.Tit_FecRegistro, T.Tit_FecLimite, T.Tit_FecTerminacion,
			A.PK_Alumno, A.Alu_Matricula, A.Alu_Nombre, A.Alu_Paterno, A.Alu_Materno, 
			A.Alu_Sexo, CASE WHEN A.Alu_Sexo = 1 THEN 'Hombre' WHEN A.Alu_Sexo = 0 THEN 'Mujer' END AS Alu_SexoDescripcion,
			C.PK_Carrera, C.Car_Nombre, C.Car_NombreCorto, C.Car_Modalidad, CASE WHEN C.Car_Modalidad = 1 THEN 'Escolarizado' WHEN C.Car_Modalidad = 2 THEN 'Semiescolarizado' END AS Car_ModalidadDescripcion,
			D.PK_Departamento, D.Dep_Nombre, D.Dep_Abreviatura,
			TM.PK_TitModalidad, TM.TMo_Nombre, 
			IFNULL(T.FK_Personal_Director,0) AS PK_Personal_Dir, IFNULL(P.Per_Nombre, '') AS Per_Nombre_Dir, IFNULL(P.Per_Paterno, '') AS Per_Paterno_Dir, IFNULL(P.Per_Materno, '') AS Per_Materno_Dir, 
			IFNULL(PA.PK_ProfAsoc, 0) AS PK_ProfAsoc, IFNULL(PA.PAs_Nombre, '') AS PAs_Nombre, IFNULL(PA.PAs_NombreCorto, '') AS PAs_NombreCorto
	FROM
			t_titulacion AS T
			INNER JOIN t_alumno AS A ON T.FK_Alumno = A.PK_Alumno
			INNER JOIN t_carrera AS C ON C.PK_Carrera = A.FK_Carrera
			INNER JOIN t_titulacionmodalidad AS TM ON TM.PK_TitModalidad = T.FK_TitModalidad
			INNER JOIN t_departamento AS D ON T.FK_Departamento = D.PK_Departamento
			LEFT JOIN t_personal AS P ON T.FK_Personal_Director = P.PK_Personal
			LEFT JOIN t_profesionalasociado AS PA ON T.FK_ProfAsoc = PA.PK_ProfAsoc
	WHERE 
			T.Tit_Estatus = 1
			AND CASE WHEN pPK_Titulacion IS NULL THEN TRUE ELSE T.PK_Titulacion = pPK_Titulacion END
			AND CASE WHEN pPK_Alumno IS NULL THEN TRUE ELSE A.PK_Alumno = pPK_Alumno END
			AND CASE WHEN pAlu_Matricula IS NULL THEN TRUE ELSE A.Alu_Matricula = pAlu_Matricula END
			AND CASE WHEN pAlu_Sexo IS NULL THEN TRUE ELSE A.Alu_Sexo = pAlu_Sexo END
			AND CASE WHEN pPK_Carrera IS NULL THEN TRUE ELSE C.PK_Carrera = pPK_Carrera END
			AND CASE WHEN pPK_Departamento IS NULL THEN TRUE ELSE D.PK_Departamento = pPK_Departamento END
			AND CASE WHEN pPK_TitModalidad IS NULL THEN TRUE ELSE TM.PK_TitModalidad = pPK_TitModalidad END
			AND CASE WHEN pPK_ProfAsoc IS NULL THEN TRUE ELSE PA.PK_ProfAsoc = pPK_ProfAsoc END
			AND CASE WHEN pTipoTitulacion IS NULL THEN TRUE ELSE T.Tit_Tipo = pTipoTitulacion END;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_VinculacionNivelParticipacion_I
DELIMITER //
