-- Volcando estructura para procedimiento db_produc.sp_VinculacionNivelParticipacion_S
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_VinculacionNivelParticipacion_S`(
	IN `pPK_VincNivePart` TINYINT

)
BEGIN
	SELECT
			VNP.PK_VincNivePart, VNP.VNP_Nombre
	FROM
			t_vinculacion_nivelparticipacion AS VNP
	WHERE
			VNP.VNP_Estatus =1
			AND CASE WHEN pPK_VincNivePart IS NULL THEN TRUE ELSE VNP.PK_VincNivePart = pPK_VincNivePart END;

END//
DELIMITER ;

-- Volcando estructura para procedimiento db_produc.sp_VinculacionNivelParticipacion_U
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_VinculacionNivelParticipacion_U`(IN `pPK_VincNivePart` INT,
	IN `pVNP_Nombre` VARCHAR(50),
	IN `pVNP_Estatus` BIT,
	IN `pFK_Usuario` INT,
	IN `pObservacion` LONGTEXT

,
	IN `pQuery` LONGTEXT)
BEGIN

	IF pVNP_Estatus = 0 THEN
		UPDATE	t_vinculacion_nivelparticipacion
		SET 		VNP_Estatus = 0
		WHERE  	PK_VincNivePart = pPK_VincNivePart;
		
		SELECT @vBit_Accion :=  2;
	ELSE
		UPDATE 	t_vinculacion_nivelparticipacion
		SET 		VNP_Nombre = pVNP_Nombre
		WHERE  	PK_VincNivePart = pPK_VincNivePart;
		
		SELECT @vBit_Accion :=  3;
	END IF;
	
	CALL sp_Bitacora_I('t_vinculacion_Nivelparticipacion ', pPK_VincNivePart, pFK_Usuario, @vBit_Accion, pObservacion, pQuery);

END//
DELIMITER ;

